import React from 'react';
import "./Square.css";

const Square = (props) => {

    const [value, setValue] = React.useState(null);

    const clickHandler = (e) => {
        setValue("X");
    }

    return (
        <button className="square" onClick={clickHandler}>{props.value}</button>
    );
};

export default Square;
